import Vue from 'vue'
import VueRouter from 'vue-router'
import Global from '../views/Global.vue'
import AFR from '../views/AFR.vue'
import SFR from '../views/SFR.vue'
import CLC from '../views/CLC.vue'
import TRNG from '../views/TRNG.vue'
import TRIG from '../views/TRIG.vue'
import TRNF from '../views/TRNF.vue'
import TRID from '../views/TRIG.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'Global',
    component: Global
  },
  {
    path: '/afr',
    name: 'AFR',
    component: AFR
  },
  {
    path: '/sfr',
    name: 'SFR',
    component: SFR
  },
  {
    path: '/clc',
    name: 'CLC',
    component: CLC
  },
  {
    path: '/trng',
    name: 'TRNG',
    component: TRNG
  },
  {
    path: '/trig',
    name: 'TRIG',
    component: TRIG
  },
  {
    path: '/trnf',
    name: 'TRNF',
    component: TRNF
  },
  {
    path: '/trid',
    name: 'TRID',
    component: TRID
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    //component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  }
]

const router = new VueRouter({
  routes
})

export default router
